import React from 'react';
import HEAD from './CODE/HEAD/HEAD.js'
import CONTENT from './CODE/CONTENT/CONTENT.js'
import FOOTER from './CODE/FOOTER/FOOTER'
import s from './App.module.css'

import { BrowserRouter } from 'react-router-dom';






function App() {
  return (
    <BrowserRouter>
    {/* s.wrapper */}
      <div className={s.wrapper_X}>  
        <HEAD className={s.wrapper_Xgrid} />
        <CONTENT  className={s.wrapper_Xgrid} />
        <FOOTER className={s.wrapper_Xgrid}/>
      </div>
    </BrowserRouter>
  );
}

export default App;
